INSERT INTO `proximes_modes` (`id`, `id_usuari`, `titol`, `cos`, `nom_imatge`) VALUES
(1, 12, 'EL ROJO', '\"Los diseñadores quieren vestirme de primavera, con prendas vaporosas. Pero yo no tengo ganas de primavera. Yo me siento como el cálido rojo del otoño\" dijo en una ocasión Marilyn Monroe. Pues bien, el momento ha llegado y el color ya está aquí como la tendencia más poderosa de los próximos meses.', 'ilHpm32x2x9mziIawdd6Ox9P9I4CyWO8iH1j53kI.jpeg'),
(2, 12, 'EL TURQUESA', 'Quienes viven en el norte han llegado a estas alturas a la conclusión de que en algunas latitudes el verano es una actitud ante la vida. Y cuando se apague la estación y llegue el entretiempo, la moda nos regalará una oportunidad extra de observar el azul del mar de Formentera. El turquesa es uno de los grandes descubrimientos de la nueva temporada.', 'y4u8PCvORgAXUbtRPuML6cISJPlD9Ei3HIHjVjca.jpeg'),
(3, 12, 'LOS MENSAJES PODEROSOS', 'n la ropa, en los accesorios y hasta en los zapatos: estás a punto de ver cómo la moda se impregna de tipografías y mensajes. Están ya en Versace... y posiblemente pronto estén en Zara.', 'swtYsIm6ocXjj6sE9y8CC4y0XWK71VNKXO9Vd1WJ.jpeg');

